import React, { Component } from 'react';
import "../css/shopitems.min.css"
class ShopItems extends Component {
    state={
        array: ['pierwszy','drugi','trzeci','cztery','piaty','szosty','siodmy','ósmy','dziewiąty','dziesiąty']
    }
    render() {
        const listItems=this.state.array.map((item)=>
            <li>{item}</li>
        )
        return (
            <div shop__items>
                <h1>Tu bedą itemy</h1>
                <div shop__items__elements>
                    {listItems}
                </div>
            </div>
        );
    }
}

export default ShopItems;
